import React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { Button, Link, Typography } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import '../App.css';
import SearchBar from './SearchBar';
import Avatar from '@mui/material/Avatar';
import PersonIcon from '@mui/icons-material/Person';
import ContentCutIcon from '@mui/icons-material/ContentCut';
import VideoCallIcon from '@mui/icons-material/VideoCall';

const StyledPaper = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
  '& .MuiButton-root': {
    marginTop: theme.spacing(1),
    textTransform: 'none',
  },
}));

export default function Dashboard() {
  return (
    <Box style={{ position: 'relative', minHeight: '100vh' }}>
      <Grid container>
        <Grid item xs={2}>
          <StyledPaper sx={{ height: '100%' }}>
            <Typography variant='h4' sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>Logo</Typography>
            <Box className='button' sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', gap: '1rem' }}>
              <Button variant="outlined" endIcon={<AddIcon />} className='button-style'>New Video</Button>
              <Button variant="outlined" className='button-style'>Home</Button>
              <Button variant="outlined" className='button-style'>Template</Button>
              <Button variant="outlined" className='button-style'>All Videos</Button>
            </Box>
          </StyledPaper>
        </Grid>
        <Grid item xs={10}>
          <Box>
            <Grid container alignItems='center'>
              <Grid item xs={11}>
                <SearchBar />
              </Grid>
              <Grid item xs={1}>
                <Avatar>
                  <PersonIcon />
                </Avatar>
              </Grid>
            </Grid>
          </Box>
          <Box sx={{ ml: '2%' }}>
            <Grid container justifyContent='space-between' alignItems='center'>
              <Grid item>
                <Button variant="outlined" startIcon={<ContentCutIcon />} className='button-style-2' sx={{ textTransform: 'none' }}>Create Project</Button>
                <Button variant="outlined" startIcon={<VideoCallIcon />} className='button-style-2' sx={{ textTransform: 'none' }}>Record Video</Button>
              </Grid>
              <Grid item>
                <Link variant="outlined" sx={{ textTransform: 'none', marginRight: '5rem' }}>All Videos {'>'}</Link>
              </Grid>
            </Grid>
            <Box sx={{ mt: '2%', fontWeight: "bold" }}>
              <Typography variant='p'>Recent Videos</Typography>
              <Grid container sx={{ mt: '30px', gap: '1rem' }}>
                {Array.from(Array(3).keys()).map((index) => (
                  <Grid item xs={4} key={index}>
                    <StyledPaper sx={{ height: '200px' }}>
                      <Box sx={{ width: '100%', height: '100%', border: '1px solid black', backgroundColor: '#f0f0f0' }} />
                      <Typography variant='p'>Project Name - {index + 1}</Typography>
                    </StyledPaper>
                  </Grid>
                ))}
              </Grid>
            </Box>
          </Box>
        </Grid>
      </Grid>

      {/* Bottom content */}
      <Grid container className='bottom' style={{ backgroundColor:'gray', height:'50px', position: 'absolute', bottom: 0, left: 0, width: '100%' }}>
        {/* Content */}
      </Grid>
    </Box>
  );
}
